framework:
    name: tensorflow
    inputs: new_numeric_placeholder,new_categorical_placeholder
    outputs: import/head/predictions/probabilities

calibration:
    iterations: 2000
    algorithm:
        activation: minmax

tuning:
    accuracy_criterion:
        relative: 0.001
    timeout: 0
    random_seed: 9527
    ops: {
           'import/dnn/hiddenlayer_0/MatMul': {
             'activation':  {'dtype': ['uint8'], 'algorithm': ['minmax'], 'scheme':['asym']},
           }
         }

